import React, { useEffect } from "react";
import { NavLink, useNavigate } from "react-router-dom";

import "../CSS/matchSelector.css";

function MatchTypeSelector(props) {
  const history = useNavigate();

  const redirectToStats = () => {
    history.push("/stats");
  };

  return (
    <div>
      <br />
      <div className="row">
        <div className="col-md-1"></div>
        {props.type === "stats" ? (
          <div className="col-md-5">
            <h6 className="tab" onClick={redirectToStats}>
              Stats
            </h6>
          </div>
        ) : (
          <div className="col-12 col-md-5">
            <h6 className="" onClick={redirectToStats}>
              Stats
            </h6>
          </div>
        )}
        {props.type === "compare" ? (
          <div className="col-md-5">
            <NavLink to="/compare">
              <h6 className="tab">Compare</h6>
            </NavLink>
          </div>
        ) : (
          <div className="col-md-5">
            <NavLink to="/compare">
              <h6 className="">Compare</h6>
            </NavLink>
          </div>
        )}
        <div className="col-md-1"></div>
      </div>
    </div>
  );
}

export default MatchTypeSelector;
